import React from "react";

function NavHeader() {
    return (
        <header className="App-header">
            <div class="header-bg">
                <section>
                    <h1>
                        <a href="/">Rankd</a>
                    </h1>
                </section>
            </div>
        </header>
    )
}

export default NavHeader;
